import React, { useState } from 'react';
import MainView from './MainView';
import LastMonthView from './LastMonthView';
import LastYearView from './LastYearView';
import CompareMonthsView from './CompareMonthsView';
import CompareYearsView from './CompareYearsView';
import DataInputView from './DataInputView';
import InformationView from './InformationView';

const viewComponents = {
  main: MainView,
  lastMonth: LastMonthView,
  lastYear: LastYearView,
  compareMonths: CompareMonthsView,
  compareYears: CompareYearsView,
  dataInput: DataInputView,
  information: InformationView,
};

const App = () => {
  const [currentView, setCurrentView] = useState('main');

  const renderView = () => {
    const ViewComponent = viewComponents[currentView] || MainView;
    return <ViewComponent setView={setCurrentView} />;
  };

  return (
    <div className="App">
      {renderView()}
    </div>
  );
};

export default App;
